import React from 'react'

function Home() {
  return (
    <div className='home'>
      <div className='about'> 
      <h2> Hi, My name is Amal</h2>
      <div className='prompt'> My name is Amal and I started studying computer science on 09/1//2022 and I didn't think it would be so interesting. Now I have a lot of motivation and a desire to continue studying, since I have goals for 2023 that I want to achieve and coding will help me with this. This is not all about me, I will write more </div>
      </div>
      <div className='skills'> </div>
    </div>
  )
}

export default Home
